import React, { useState } from "react";
import axios from "axios";

function FileUpload() {
  const [fileInput1, setFileInput1] = useState(null);
  const [fileInput2, setFileInput2] = useState(null);
  const [filenames, setFilenames] = useState([]);
  const [checksum, setChecksum] = useState(null);

  const handleFile1Change = (event) => {
    setFileInput1(event.target.files[0]);
  };

  const handleFile2Change = (event) => {
    setFileInput2(event.target.files[0]);
  };

  const handleUpload = async () => {
    if (!fileInput1 || !fileInput2) {
      console.error("Please select two files for comparison");
      return;
    }

    const formData = new FormData();
    formData.append("files", fileInput1);
    formData.append("files", fileInput2);

    try {
      const response = await axios.post("http://localhost:5000/api/upload", formData);
      setFilenames([...filenames, ...response.data.filenames]);
      setChecksum(response.data.checksum);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <input type="file" onChange={handleFile1Change} />
      <input type="file" onChange={handleFile2Change} />
      <button onClick={handleUpload}>Upload</button>
      <ul>
        {filenames.map((filename, index) => (
          <li key={index}>{filename}</li>
        ))}
      </ul>
      {checksum && <p>Checksum: {checksum}</p>}
    </div>
  );
}

export default FileUpload;
